import React from 'react';

const viewAll = (props) => {
  const view = (event) => {
    props.viewAllFilter(event.target.value);
  };
  return (
    <div>
      <button className="dropdown" onClick={(event) => view(event)}>ViewAll</button>
    </div>
  );
};
 
export default viewAll;
